import React,{useState, useEffect} from 'react';
import Axios from "axios";

export default function mapsTable() {

useEffect(()=>{
    const [mapList, setMapList] = useState([])

    Axios.get('http://localhost:3002/api/get').then((response) =>{
    setMapList(response);
    });
}),[];

  return (
    <div>
        {
            mapList.map((val)=>{
                return <h1>{val.id}</h1>
            })

        }

    </div>
  )
}
